/**
 * Example interval
 * @constructor
 */
function DummyStopped() {
    process.exit(1);
}

/**
 * Is the interval active?
 * @type {boolean}
 */
DummyStopped.active = false;

/**
 * Max instances running in parallel
 * @type {number}
 */
DummyStopped.instances = 1;

/**
 * Optional schedule method
 * @return {boolean}
 */
DummyStopped.schedule = function() {
    return true;
};

/**
 * Exports
 */
exports = module.exports = DummyStopped;
